import React from "react"

function AddContent(){
    const Styles = {
        backgroundColor: "white",
        padding: "0px 50px 0px 50px",
        margin: "10px auto",
        width: "40%",
        borderRadius: "10px",
        border: "1px solid black",
        boxShadow: "0 4px 8px 0 rgba(0,0,0,0.2)",
    }
    return(
        <div style={Styles}>
            <h1>sdvvf</h1>
        </div>
    );
}

export default AddContent;
